  "Early Victorian New Zealand", OUP (1958).
  01> MILLER, Helen Jane m on 26.02.1994 to BASSETT, Timothy Charles
  b 22.04.1961
  b 28.11.1960
  Address: 9a Edinburgh Street, Hillcrest, Hamilton.
  Helen was educated at Fairfield College and Nelson Polytechnic. She trained at
  Wairau Hospital, Blenheim and became a state registered comprehensive nurse in 1983.
  From 1984 to 1988 she was overseas relief nursing in various London hospitals,
  waitressing at Cranks, and supervising a cleaning gang in a building site. She also
  cycled to Greece. From 1988 she was P/T at Waikato Hospital. She graduated from
  Waikato University with a BA in 1991 and MA(Hons) in English in 1994. She is presently teaching
  English at Hamilton Girls' High School.
  Timothy was educated at St Paul's Collegiate and Fairfield College and graduated BSocsc from the
  University of the Waikato in 1994. In 1984 he gained a Diploma in Drama from the New Zealand Drama
  School. He is presently a community service manager with IHC in Hamilton.
  01> BASSETT, Zachary Bernard
  b 11.06.1993
  02> MILLER, Michael Bernard Leofric
  b 20.08.1962
  Address: 8 Thames Street, Hamilton.
  Michael was educated at Fairfield College and the University of Canterbury (1983-85). He won a New
  Zealand Gold Medal for lightweight schoolboys' rowing, and was entertainment officer with the Hot
  Goblins Band. He has travelled through Australia and India and worked with children under the
  sponsorship of the Waikato Sports Foundation. He is currently writing music and playing with the
  Tsunami Band in Hamilton.
  02> MILLER, Maryrose m on 24.09.1952 to WILSON, Godfrey Edward Armstrong
  b 15.10.1926
  b 02.09.1926
  Maryrose b. at Timaru and m. at London, England, Godfrey, s/o Clement Henry
  Wilson and Ida Agnes Clarkson. Address: 30 Maryland Street, Point Chevalier,
  Auckland.
  Maryrose was educated at Samuel Marsden Collegiate School, Wellington
  (1939-44) and Canterbury University (1946-49, MA(Hons) in English. When a
  student at University, Maryrose acted under the direction of Ngaio Marsh and
  toured the country as Lady Macbeth. Later she toured Australia in Shakespeare's "Othello" and
  Pirandello's "Six Characters in Search of an Author". She gained a Certificate in Anglican Studies from
  the General Theological Seminary, New York (1984-85) and a Diploma in Spiritual Direction from Pecos
  Benedictine Monastery, New Mexico (1988-89). She was a council member, including eight years as
  Chairperson of the Management Committee, of the Victoria House Students' Hostel, Wellington (1963-78)
  and from 1965 to 1981 she was active in the fields of Family Life Education and Marriage Guidance and
  was coordinator of a Red Cross family support team in South Auckland. Within the Church, she was a
  member of the Wellington Anglican Diocesan Commission on Mission (1975-76) and the Joint Working
  Committee of the National Council of Churches and the Roman Catholic Church (1975-78). She was Chaplain
  of Friendship House, Manukau City, (1986-95) and has also been a member of the Scholarships Committee
  of St John's College Trust Board since 1991 (Chairperson since 1993), and a member of the H & W
  Williams Trust Board. Since 1996 Maryrose has worked part-time for South Auckland Counselling Services
  (cont...)
